            function clickLink(sender) {
              var url = sender.prop("href");
              setCarouselNav(url);
            }

            function loadFrame(sender) {
              var siteIndex = sender.prop("siteindex");

              // Load content to frame
              $("#display_frame").attr("src", sites[siteIndex].url);
              setCarouselNav(sites[siteIndex].url);
            }

            function setCarouselNav(url) {
              // Set live preview link
              $("a#linkLivePreview").prop("href", url);

              // Get position
              var curIndex = sites
                .map(function(e) {
                  return e.url;
                })
                .indexOf(url);

              // Previous
              var prevIndex = curIndex - 1;
              if (prevIndex < 0) {
                prevIndex = sites.length - 1;
              }

              // Next
              var nextIndex = curIndex + 1;
              if (nextIndex > sites.length - 1) {
                nextIndex = 0;
              }

              // Preload frame content;
              // load previous
              preloadContent(sites[prevIndex].url, prevIndex);
              $("#modal-webitPreview #btnPrevious").prop(
                "siteindex",
                prevIndex
              );
              // load next
              preloadContent(sites[nextIndex].url, nextIndex);
              $("#modal-webitPreview #btnNext").prop("siteindex", nextIndex);
            }

            $(document).ready(function() {
              // Anchor Scrolling
              $("a[href*=\\#]").on("click", function(e) {
                var target = this.hash;
                var $target = $(target);
                console.log(targetname);
                var targetname = target.slice(1, target);

                if (document.getElementById(targetname) != null) {
                  e.preventDefault();
                }
                $("html, body")
                  .stop()
                  .animate({
                      scrollTop: $target.offset().top, //or the height of your fixed navigation
                    },
                    900,
                    "swing",
                    function() {
                      window.location.hash = target;
                    }
                  );
              });
            });
